  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Tamarac
  National Wildlife Refuge summarizes Refuge activities during the 2000 fiscal year.
  \ The report begins with an introduction to the Refuge and a summary of the yearu2019s
  highlights and climatic conditions.  Information about monitoring and studies- including
  surveys and censuses- is provided next.  Habitat restoration and management projects
  are also covered; activities include wetland restoration, water level management,
  farming, timber management, fire management, and vegetation control.  Fish and wildlife
  management is discussed next with emphasis on bird banding.  Coordination activities,
  such as interagency coordination and private land activities, are outlined.  The
  resource protection section provides information about law enforcement and permits.
  \ Information about public education and recreation is given including visitor services.
  \ Finally, Refuge planning and administration are discussed.  Refuge brochures are
  attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
